import React from 'react'
import {HeaderLogo} from './HeaderLogo';
import {SearchBar} from './SearchBar'
import {NavBar} from './NavBar';
import UserProfile from './UserProfile';

export default function Header() {
  return (
    <div>
        <div> 
          <HeaderLogo/>
          <SearchBar/>
        </div>
        <div>
          <NavBar/>
        </div>
        <div>
            <UserProfile />
        </div>
    </div>
  )
}
